pragma solidity 0.6.11;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/access/Ownable.sol";
import "../../common/IStartrailRegistry.sol";
import "../../lib/contracts/IDGenerator.sol";
import "../../lib/contracts/Signature.sol";
import "../../common/IRootLogic.sol";
import "../../common/IStartrailValidator.sol";
import "../../name/contracts/NameRegistry.sol";
import "../../name/contracts/Contracts.sol";

contract StartrailRegistry is
  OwnableUpgradeSafe,
  ERC721UpgradeSafe,
  IStartrailRegistry,
  IStartrailValidator,
  Contracts
{
  /*
   * State variables
   */
  uint256 private idNonce;

  /*
   * Storage
   */
  address private _nameRegistryAddress;

  function getMsgSender() public view returns (address) {
    return _msgSender();
  }

  /**
   * @dev Initializes the StartrailRegistry
   * @param name string of the name
   * @param symbol string of the symbol
   * @param nameRegistry address of the NameRegistry contract
   */
  function initialize(
    string memory name,
    string memory symbol,
    address nameRegistry
  ) public initializer {
    _nameRegistryAddress = nameRegistry;
    idNonce = 1;
    ERC721UpgradeSafe.__ERC721_init(name, symbol);
    OwnableUpgradeSafe.__Ownable_init();
  }

  /**
   * @dev Creates a new StartrailRegistryRecordID
   * @param sender address of the sender
   */
  function mint(address sender)
    external
    override
    onlyRootLogic(_rootLogicAddress())
    returns (uint256)
  {
    idNonce += 1;
    uint256 tokenId;
    do {
      tokenId = IDGenerator.generate(idNonce);
    } while (ERC721UpgradeSafe._exists(tokenId));
    ERC721UpgradeSafe._mint(sender, tokenId);
    return tokenId;
  }

  /**
   * @dev Transfers the ownership of a given SRR ID to another address.
   * @param from address of the current owner
   * @param to address to receive the ownership
   * @param tokenId uint256 ID of the SRR to be transferred
   */
  function transferSRRFrom(
    address from,
    address to,
    uint256 tokenId
  ) external override onlyRootLogic(_rootLogicAddress()) {
    require(
      ERC721UpgradeSafe._exists(tokenId),
      "ERC721: operator query for nonexistent token"
    );
    address owner = ERC721UpgradeSafe.ownerOf(tokenId);
    require(from == owner, "ERC721: transfer caller is not owner");
    ERC721UpgradeSafe._transfer(from, to, tokenId);
  }

  /**
   * @dev Sets the address of the NameRegistry contract
   * @param nameRegistry address of the NameRegistry contract
   */
  function setNameRegistry(address nameRegistry) public onlyOwner {
    _nameRegistryAddress = nameRegistry;
  }

  /**
   * @dev Gets the endpoint address of the RootLogic
   * @return RootLogic proxy address
   */
  function getRootLogicAddress() public view returns (address) {
    return _rootLogicAddress();
  }

  /**
   * @dev Gets the endpoint address of NameRegistry
   * @return NameRegistry proxy address
   */
  function getNameRegistryAddress() public view returns (address) {
    return _nameRegistryAddress;
  }

  /**
   * @dev Gets the owner address of the SRR
   * @param tokenId uint256 of the SRR ID
   * @return owner address
   */
  function getSRROwner(uint256 tokenId)
    external
    override
    view
    returns (address)
  {
    return ERC721UpgradeSafe.ownerOf(tokenId);
  }

  /**
   * @dev Gets the nonce from the storage
   * @return idNonce from storage
   */
  function getIdNonce() public view returns (uint256) {
    return idNonce;
  }

  function _nameRegistry() private view returns (NameRegistry) {
    return NameRegistry(_nameRegistryAddress);
  }

  function _rootLogicAddress() private view returns (address) {
    address rootLogicAddress = _nameRegistry().get(ROOT_LOGIC);
    return rootLogicAddress;
  }

  // **************************
  // scope out for Day1
  // **************************

  // /**
  //  * @dev transfers StartrailRegistry
  //  * @param to address of the receiver
  //  * @param tokenId uint256 of StartrailRegistryRecordID
  //  * @param sig signature
  //  */
  // function transferSRRFrom(
  //   address to,
  //   uint256 tokenId,
  //   Signature.Sig memory sig
  // ) public validSender(sig) {
  //   address signer = Signature.getAddress(sig);
  //   require(ownerOf(tokenId) == signer, "owner and signer do not match");
  //   super._transferFrom(signer, to, tokenId);

  //   emit TransferSRRFrom(signer, to, tokenId);
  // }

  // /**
  //  * @dev transfers StartrailRegistry
  //  * @param from address of the current token owner
  //  * @param to address of the receiver
  //  * @param tokenId uint256 of StartrailRegistryRecordID
  //  * @param _data bytes of private metadata
  //  */
  // function safeTransferSRRFrom(
  //   address from,
  //   address to,
  //   uint256 tokenId,
  //   bytes memory _data
  // ) public {
  //   super._safeTransferFrom(from, to, tokenId, _data);
  //   emit SafeTransferSRRFrom(from, to, tokenId, _data);
  //   address newOnwer = ownerOf(tokenId);
  //   IRootLogic logic = IRootLogic(_rootLogicContract);
  //   // logic.historyProvenance(tokenId, newOnwer, from, _data);
  // }
}

